commits.content:
html {
    box-sizing: border-box;
  }

  *,
  ::before,
  ::after {
    margin: 0;
    padding: 0;
    box-sizing: inherit;
  }

  a {
    text-decoration: none;
    color: inherit;
  }

  a:hover,
  a:link,
  a:visited,
  a:active {
    text-decoration: none;
  }

  ol,
  ul {
    list-style: none;
  }

  input,
  textarea {
    outline: none;
    border: none;
    resize: none;
  }
